\viewkind4\uc1\pard\ltrpar\nowidctlpar\sl180\slmult1\lang1023\f0\fs34 Spielberg shows Beijing red card over Darfur\f1\rtlch\par
\f0\ltrch In a gesture sure to rattle the Chinese Government, Steven Spielberg pulled out of the Beijing Olympics to protest against \lang1033 China's\lang1023  backing for \lang1033 Sudan's\lang1023  policy in Darfur. His withdrawal comes in the wake of fighting flaring up again in Darfur and is set to embarrass China, which has sought to halt the negative fallout from having close ties to the Sudanese government. China, which has extensive investments in the Sudanese oil industry, maintains close links with the Government, which includes one minister charged with crimes against humanity by the International Criminal Court in The Hague. Although emphasizing that Khartoum bears the bulk of the responsibility for these ongoing atrocities, Spielberg maintains that the international community, and particularly China, should do more to end the suffering.\f1\rtlch\par
